Speed â€‹â€‹came to China. He didn't know that there were so many people who knew him and liked him living in this magical land. The fans here showed him unimaginable enthusiasm. What shocked him and his team was that the fans here respected him very much. They were excited but very restrained when they saw him. They knew that he was tired and would give him water. They knew that he was hungry and would feed him. This was the case in every city he passed through! Because this is the Chinese etiquette of hospitality. Friends coming from afar must be fed and well-nourished!

He met Tian Yiming and sang his favorite song "Love You at 105 Degrees" together;

He climbed the Great Wall and saw the super weapon of Chinese aunties: "Level 10 Beauty";

He went to Shaolin Temple, made friends through martial arts and met Master Liang, who may be the best martial arts teacher in his life;

He ate an authentic Chengdu hot pot and tasted what authentic spicy and hot is;

He saw why Chongqing is called the cyberpunk city, and also showed the world the real shock of China beyond the foreign media filter;

He had a beautiful encounter on a cruise ship in Hong Kong that saved the entire live broadcast. A sweet girl from Zhejiang showed him the cuteness, friendliness, innocence and romance of Chinese girls;

He experienced the high-tech from China in Shenzhen that stunned the world;

He finally came to Changsha and finally met Da Zhangwei, and sang Sunshine Rainbow Little White Horse together. It was also because of Da Zhangwei's popular song that he won countless fans in China;

He also met a friendly and enthusiastic Chinese uncle who treated him as a brother. He followed him all the way in various cities in China and took care of him willingly. This is the best interpretation of fate and friendship from Chinese men!

Thank you Speed, thank you for showing the world the true side of this country and the people on this land!

There is an old Chinese saying: "It is a great pleasure to have friends coming from afar! All people in the world are brothers!"
